import React from "react";

const AboutCV = () => {
  return (
    <>
      <div className="box">
        <p>
          <span> age : </span> 21
        </p>
        <p>
          <span> gender : </span> male
        </p>
        <p>
          <span> language : </span> bangla, english
        </p>
        <p>
          <span> work : </span> full stack react developer
        </p>
      </div>
    </>
  );
};

export default AboutCV;
